sp_widget.client_script:
function($scope, $timeout, spUtil, $location, $rootScope, spUtil) {
    var c = this;
    c.requestComment = '';
    c.requestItem = '';
    c.needComment = false;
    c.needReason = false;
    c.modalMessage = '';
    c.isLoading = true;
    c.reopeningReason = false;
    c.disableAction = false;
    c.stateChanged = false;
    c.contentOpened = false;

    $scope.loadingIndicator = $rootScope.loadingIndicator;
    //Show widget after loaded
    $scope.$on('sp_loading_indicator', function(e, value) {
        if ($scope.loadingIndicator && !value) {
            c.isLoading = false;
        }
        $scope.loadingIndicator = value;
    });

    spUtil.recordWatch($scope, "task", c.data.requestsID, function(event) {
        if (event.data.record.state) {
            c.server.get({
                action: "stateChangedBackend",
                itemID: event.data.sys_id,
                newState: event.data.record.state,
                requests: c.data.requests
            }).then(function(response) {
                c.data.requests = response.data.requests;
                if (c.stateChanged) {
                    c.stateChanged = false;
                    $timeout(function() {
                        c.disableAction = false;
                    }, 1000);
                }
            });
        }
    });

    spUtil.recordWatch($scope, "sc_req_item", c.data.ritmID, function(event) {
        if (event.data.record.state) {
            c.server.get({
                action: "ritmStateChangedBackend",
                itemID: event.data.sys_id,
                newState: event.data.record.state,
                requests: c.data.requests
            }).then(function(response) {
                c.data.requests = response.data.requests;
            });
        }
    });

    $scope.$on('applyFilter', function(event, filters) {
        c.data.statusFilter = filters.statusFilter;
        c.data.typeFilter = filters.typeFilter;
        c.isLoading = true;
        c.data.action = "applyFilter";
        c.server.update().then(function(response) {
            c.verifyEmptySearch();
            c.newRecordWatch();
        });
    });

    $scope.$on('applyDate', function(event, daysAgo) {
        c.data.dateFilter = daysAgo;
        c.data.action = "applyDate";
        c.server.update().then(function(response) {
            $timeout(function() {
                scrollTo("list-columns");
            }, 200);
            c.verifyEmptySearch();
            c.newRecordWatch();
        });
    });

    $scope.$on('clearAllFilters', function(event) {
        c.data.requests = [];
        for (var i in c.data.typeFilter) {
            c.data.typeFilter[i].selected = false;
        }
        for (i in c.data.statusFilter) {
            c.data.statusFilter[i].selected = false;
        }
        c.verifyEmptySearch();
    });

    c.verifyEmptySearch = function() {
        c.data.showFilterClean = true;
        if (c.data.requests.length > 0) {
            c.data.showFilterClean = false;
        }
    }

    c.itemAction = function(item, action, fullItem) {
        c.disableAction = true;

        if (action == "acceptSolution") {
            fullItem.showSurvey = true;
        }

        if (action == "acceptSolution" || action == "acceptCancellation" ||
            action == "cancelItem" && item.table == "u_question") {

            c.server.get({
                action: 'changeItemState',
                state: action,
                item: item,
                reopeningReason: false
            }).then(function(response) {
                item = response.data.item;
                c.data.show_survey = response.data.show_survey;
                c.data.gserviceSurvey = response.data.gserviceSurvey;
                c.disableAction = false;
            });
        } else {
            if (action == "rejectSolution" || action == "rejectCancellation")
                c.modalMessage = c.data.msgs.reject;
            else
                c.modalMessage = c.data.msgs.cancel;
            for (var i in c.data.reopeningReason) {
                c.data.reopeningReason[i].selected = false;
            }
            $('#requestCommentModal').modal("show");
            c.requestItem = item;
            c.state = action;
            $timeout(function() {
                c.disableAction = false;
            }, 1000);
        }
    }

    c.submitRequestComment = function() {
        if (c.state == "rejectSolution") {
            var stop = false;
            if (!c.requestComment) {
                c.needComment = true;
                stop = true;
            } else if (c.requestComment.length < 100) {
                c.needComment = true;
                stop = true;
            } else {
                c.needComment = false;
            }
            if (!c.reopeningReason) {
                c.needReason = true;
                stop = true
            } else
                c.needReason = false;
            if (stop) {
                return;
            }
        } else if (c.state == "cancelItem") {
            var stop = false;
            if (!c.requestComment) {
                c.needComment = true;
                stop = true;
            } else if (c.requestComment.length < 100) {
                c.needComment = true;
                stop = true;
            } else {
                c.needComment = false;
            }
            if (stop) {
                return;
            }
        }
        c.disableAction = true;
        c.stateChanged = true;
        if (c.state != "rejectSolution") {
            if (c.requestComment) {
                c.reopeningReason = false;
                c.needComment = false;
                c.server.get({
                    action: "changeItemState",
                    state: c.state,
                    item: c.requestItem,
                    comment: c.requestComment,
                    reopeningReason: c.reopeningReason
                }).then(function(response) {
                    $('#requestCommentModal').modal("hide");
                    c.requestComment = '';
                    $timeout(function() {
                        c.disableAction = false;
                    }, 3000);
                });
            } else
                c.needComment = true;
        } else {
            c.needReason = false;
            c.needComment = false;
            c.server.get({
                action: "changeItemState",
                state: c.state,
                item: c.requestItem,
                comment: c.requestComment,
                reopeningReason: c.reopeningReason
            }).then(function(response) {
                $('#requestCommentModal').modal("hide");
                c.requestComment = '';
                $timeout(function() {
                    c.disableAction = false;
                }, 3000);
            });
        }
    }

    c.showDetails = function(item) {
        var showDetails = false;
        var index = 0;
        for (var i in c.data.requests) {
            if (c.data.requests[i].sys_id == item.sys_id) {
                index = i;
                c.data.requests[i].showDetails = !c.data.requests[i].showDetails;
                showDetails = c.data.requests[i].showDetails;
            } else {
                c.data.requests[i].showDetails = false;
            }
        }
        if (showDetails) {
            c.server.get({
                action: 'getTicketConversationWidget',
                item: item
            }).then(function(response) {
                c.data.ticketConversationWidget = response.data.ticketConversationWidget;
                if (item.table == "sc_request") {
                    c.data.requests[index] = response.data.newItem;
                    c.data.ritm_fields = response.data.ritm_fields;
                }
            });
        }

    }

    c.orderBy = function(order, items) {
        c.data.action = "orderBy";
        c.data.order = order;
        c.server.update().then(function(response) {
            c.newRecordWatch();
        });
    }

    c.statusColor = function(status) {
        var statusClass = '';
        if (status == 2) {
            statusClass = 'status_flow_empty';
        } else if (status == true) {
            statusClass = 'status_flow_active';
        } else if (!status) {
            statusClass = 'status_flow_completed';
        }
        return statusClass;
    }

    $scope.$on("getSearchedItemsFilter", function(event, searchTerm) {
        c.data.searchTerm = searchTerm;
        c.data.action = "searchResult";
        c.server.update().then(function(response) {
            c.verifyEmptySearch();
            c.newRecordWatch();
        });
    });

    $scope.$on("getSearchedItemsFilterClear", function(event) {
        c.data.action = "applyDefaultFilter";
        c.server.update().then(function(response) {
            c.verifyEmptySearch();
            c.newRecordWatch();
        });
    });

    $scope.$on('selectRequest', function(event, item_id) {
        c.data.item_id = item_id;
        c.data.action = "selectRequest";
        c.server.update().then(function(response) {
            c.openContent();
            $timeout(function() {
                scrollTo("list-columns");
            }, 200);
            c.verifyEmptySearch();
            c.newRecordWatch();
        });
    });

    $('#requestCommentModal').on('hide.bs.modal', function() {
        c.requestComment = "";
        c.reopeningReason = false;
        c.needComment = "";
        c.needReason = false;
    });

    c.previousPage = function() {
        c.data.actualPage--;
        c.updatePageCount();

    }
    c.nextPage = function() {
        c.data.actualPage++;
        c.updatePageCount();
    }

    c.updatePageCount = function() {
        c.data.window_start = c.data.actualPage * c.data.items_per_page;
        c.data.window_end = c.data.window_start + c.data.items_per_page;
        c.data.action = "changePage";
        c.server.update().then(function(response) {
            c.newRecordWatch();
        });

    }

    c.newRecordWatch = function() {
        spUtil.recordWatch($scope, "task", c.data.requestsID, function(event) {
            if (event.data.record.state) {
                c.server.get({
                    action: "stateChangedBackend",
                    itemID: event.data.sys_id,
                    newState: event.data.record.state,
                    requests: c.data.requests
                }).then(function(response) {
                    c.data.requests = response.data.requests;
                    if (c.stateChanged) {
                        c.stateChanged = false;
                        $timeout(function() {
                            c.disableAction = false;
                        }, 1000);
                    }
                });
            }
        });
    }

    if (c.data.urlItem && c.data.first_load) {
        $timeout(function() {
            scrollTo("items-content");
            c.openContent();
        }, 500);
    }

    c.selectedChoice = function(index) {
        for (var i in c.data.reopeningReason) {
            c.data.reopeningReason[i].selected = false;
        }
        c.data.reopeningReason[index].selected = c.data.reopeningReason[index].label;
        c.reopeningReason = c.data.reopeningReason[index].value;
    }

    c.openItem = function(ritm) {
        c.data.showRecordDetails = false;
        c.server.get({
            action: "openRITM",
            ritm: ritm
        }).then(function(response) {
            c.data.recordDetailsWidget = response.data.recordDetailsWidget;
            c.data.showRecordDetails = true;
            $('#ritmDetails').modal("show");
        });
    }

    $scope.$on('surveyClosed', function(event) {
        c.data.show_survey = false;

    });

	c.verifySitResponse = function(){
		var sit_message = c.data.sit_message;
		if(sit_message != undefined && sit_message != null && sit_message != ''){
			spUtil.addInfoMessage(sit_message);
		}

		if(c.data.sit_update_status){
			var url = new URL(window.location.href);
			url.searchParams['delete']('sit_id');
			url.searchParams['delete']('had_interaction');
			url.search = url.searchParams.toString();
			var new_url = url.toString();

			if(c.data.sit_update_status == 'updated'){
				c.data.sit_message = 'Resposta enviado com sucesso! Você respondeu que ' + (c.data.had_interaction == 'no' ? 'não ' : '') + 'houve interação.';
			}
			else if(c.data.sit_update_status == 'already_updated'){
				c.data.sit_message = 'Resposta já enviada anteriormente.';
			}
			else if(c.data.sit_update_status == 'not_updated'){
				c.data.sit_message = 'Houve um problema ao enviar a resposta. Se o problema persisitir, entre em contato com a equipe responsável pela plataforma.';
			}

			c.isLoading = true;
			c.data.action = "setSitMessage";
			c.server.update().then(function(response) {

			});

			window.location.replace(new_url);
		}
	}

	c.verifySitResponse();
}

